                    </Grid>
                    <Grid item xs={1}>
                        <span className={styles.link}>
                            <Link href="/About" style={{color:'#8F8F8F'}}>About</Link>
                        </span>
                    </Grid>
                    <Grid item xs={1}>    
                        <span className={styles.link}>
                            <Link href="/Resume" style={{color:'#8F8F8F'}}>Resume</Link>
                        </span>
                    </Grid>
                </Grid>

                <div className={styles.footer}>
                    <Footer/>
                </div>

            </React.Fragment>
        )
    }
}

export default AgodaFlights;
